import type * as http from 'http';
import { IncomingMessage } from 'node:http';
import { TRPCError } from '../../@trpc/server';
import type { NodeHTTPRequest, NodeHTTPResponse } from './types';

function createBody(
  req: NodeHTTPRequest,
  opts: {
    /**
     * Max body size in bytes. If the body is larger than this, the request will be aborted
     */
    maxBodySize: number | null;
  },
): RequestInit['body'] {
  // Some adapters will pre-parse the body and add it to the request object
  if ('body' in req) {
    if (req.body === undefined) {
      // If body property exists but is undefined, return undefined
      return undefined;
    }
    // If the body is already a string, return it directly
    if (typeof req.body === 'string') {
      return req.body;
    }
    // formData use
    if (req.body instanceof IncomingMessage) {
      return req.body as any;
    }
    // If body exists but isn't a string, stringify it as JSON
    return JSON.stringify(req.body);
  }
  let size = 0;
  let hasClosed = false;

  return new ReadableStream({
    start(controller) {
      const onData = (chunk: Buffer) => {
        size += chunk.length;
        if (!opts.maxBodySize || size <= opts.maxBodySize) {
          controller.enqueue(
            new Uint8Array(chunk.buffer, chunk.byteOffset, chunk.byteLength),
          );
          return;
        }
        controller.error(
          new TRPCError({
            code: 'PAYLOAD_TOO_LARGE',
          }),
        );
        hasClosed = true;
        req.off('data', onData);
        req.off('end', onEnd);
      };

      const onEnd = () => {
        if (hasClosed) {
          return;
        }
        hasClosed = true;
        req.off('data', onData);
        req.off('end', onEnd);
        controller.close();
      };

      req.on('data', onData);
      req.on('end', onEnd);
    },
    cancel() {
      req.destroy();
    },
  });
}
export function createURL(req: NodeHTTPRequest): URL {
  try {
    const protocol =
      // http2
      (req.headers[':scheme'] && req.headers[':scheme'] === 'https') ||
      // http1
      (req.socket && 'encrypted' in req.socket && req.socket.encrypted)
        ? 'https:'
        : 'http:';

    const host = req.headers.host ?? req.headers[':authority'] ?? 'localhost';

    // eslint-disable-next-line @typescript-eslint/no-non-null-assertion
    return new URL(req.url!, `${protocol}//${host}`);
  } catch (cause) {
    throw new TRPCError({
      code: 'BAD_REQUEST',
      message: 'Invalid URL',
      cause,
    });
  }
}

function createHeaders(incoming: http.IncomingHttpHeaders): Headers {
  const headers = new Headers();

  for (const key in incoming) {
    const value = incoming[key];
    if (typeof key === 'string' && key.startsWith(':')) {
      // Skip HTTP/2 pseudo-headers
      continue;
    }

    if (Array.isArray(value)) {
      for (const item of value) {
        headers.append(key, item);
      }
    } else if (value != null) {
      headers.append(key, value);
    }
  }

  return headers;
}

/**
 * Convert an [`IncomingMessage`](https://nodejs.org/api/http.html#class-httpincomingmessage) to a [`Request`](https://developer.mozilla.org/en-US/docs/Web/API/Request)
 */
export function incomingMessageToRequest(
  req: NodeHTTPRequest,
  res: NodeHTTPResponse,
  opts: {
    /**
     * Max body size in bytes. If the body is larger than this, the request will be aborted
     */
    maxBodySize: number | null;
  },
): Request {
  const ac = new AbortController();

  const onAbort = () => {
    res.off('close', onAbort);
    req.off('aborted', onAbort);

    // abort the request
    ac.abort();
  };

  res.once('close', onAbort);
  req.once('aborted', onAbort);

  // Get host from either regular header or HTTP/2 pseudo-header
  const url = createURL(req);

  const init: RequestInit = {
    headers: createHeaders(req.headers),
    method: req.method,
    signal: ac.signal,
  };

  if (req.method !== 'GET' && req.method !== 'HEAD') {
    init.body = createBody(req, opts);

    // init.duplex = 'half' must be set when body is a ReadableStream, and Node follows the spec.
    // However, this property is not defined in the TypeScript types for RequestInit, so we have
    // to cast it here in order to set it without a type error.
    // See https://fetch.spec.whatwg.org/#dom-requestinit-duplex
    // @ts-expect-error this is fine
    init.duplex = 'half';
  }

  const request = new Request(url, init);

  return request;
}
// eslint-disable-next-line no-restricted-imports
import { isAbortError } from '../../unstable-core-do-not-import';
import type { NodeHTTPResponse } from './types';

async function writeResponseBodyChunk(
  res: NodeHTTPResponse,
  chunk: Uint8Array,
) {
  // useful for debugging 
  // console.debug('writing', new TextDecoder().decode(chunk));

  if (res.write(chunk) === false) {
    await new Promise<void>((resolve, reject) => {
      const onError = (err: unknown) => {
        reject(err);
        cleanup();
      };
      const onDrain = () => {
        resolve();
        cleanup();
      };
      const cleanup = () => {
        res.off('error', onError);
        res.off('drain', onDrain);
      };
      res.once('error', onError);
      res.once('drain', onDrain);
    });
  }
}
/**
 * @internal
 */

export async function writeResponseBody(opts: {
  res: NodeHTTPResponse;
  signal: AbortSignal;
  body: NonNullable<Response['body']>;
}) {
  const { res } = opts;

  try {
    const writableStream = new WritableStream({
      async write(chunk) {
        await writeResponseBodyChunk(res, chunk);
        res.flush?.();
      },
    });

    await opts.body.pipeTo(writableStream, {
      signal: opts.signal,
    });
  } catch (err) {
    if (isAbortError(err)) {
      return;
    }
    throw err;
  }
}
/**
 * @internal
 */

export async function writeResponse(opts: {
  request: Request;
  response: Response;
  rawResponse: NodeHTTPResponse;
}) {
  const { response, rawResponse } = opts;

  // Only override status code if it hasn't been explicitly set in a procedure etc
  if (rawResponse.statusCode === 200) {
    rawResponse.statusCode = response.status;
  }
  for (const [key, value] of response.headers) {
    rawResponse.setHeader(key, value);
  }
  try {
    if (response.body) {
      await writeResponseBody({
        res: rawResponse,
        signal: opts.request.signal,
        body: response.body,
      });
    }
  } catch (err) {
    if (!rawResponse.headersSent) {
      rawResponse.statusCode = 500;
    }
    throw err;
  } finally {
    rawResponse.end();
  }
}
/**
 * If you're making an adapter for tRPC and looking at this file for reference, you should import types and functions from `@trpc/server` and `@trpc/server/http`
 *
 * @example
 * ```ts
 * import type { AnyTRPCRouter } from '@trpc/server'
 * import type { HTTPBaseHandlerOptions } from '@trpc/server/http'
 * ```
 */

// @trpc/server

import {
  getTRPCErrorFromUnknown,
  transformTRPCResponse,
  type AnyRouter,
} from '../../@trpc/server';
import type { ResolveHTTPRequestOptionsContextFn } from '../../@trpc/server/http';
import { resolveResponse } from '../../@trpc/server/http';
// eslint-disable-next-line no-restricted-imports
import { getErrorShape, run } from '../../unstable-core-do-not-import';
import { incomingMessageToRequest } from './incomingMessageToRequest';
import type {
  NodeHTTPRequest,
  NodeHTTPRequestHandlerOptions,
  NodeHTTPResponse,
} from './types';
import { writeResponse } from './writeResponse';

/**
 * @internal
 */
export function internal_exceptionHandler<
  TRouter extends AnyRouter,
  TRequest extends NodeHTTPRequest,
  TResponse extends NodeHTTPResponse,
>(opts: NodeHTTPRequestHandlerOptions<TRouter, TRequest, TResponse>) {
  return (cause: unknown) => {
    const { res, req } = opts;
    const error = getTRPCErrorFromUnknown(cause);

    const shape = getErrorShape({
      config: opts.router._def._config,
      error,
      type: 'unknown',
      path: undefined,
      input: undefined,
      ctx: undefined,
    });

    opts.onError?.({
      req,
      error,
      type: 'unknown',
      path: undefined,
      input: undefined,
      ctx: undefined,
    });

    const transformed = transformTRPCResponse(opts.router._def._config, {
      error: shape,
    });

    res.statusCode = shape.data.httpStatus;
    res.end(JSON.stringify(transformed));
  };
}

/**
 * @remark the promise never rejects
 */
export async function nodeHTTPRequestHandler<
  TRouter extends AnyRouter,
  TRequest extends NodeHTTPRequest,
  TResponse extends NodeHTTPResponse,
>(opts: NodeHTTPRequestHandlerOptions<TRouter, TRequest, TResponse>) {
  return new Promise<void>((resolve) => {
    const handleViaMiddleware =
      opts.middleware ?? ((_req, _res, next) => next());

    opts.res.once('finish', () => {
      resolve();
    });
    return handleViaMiddleware(opts.req, opts.res, (err: unknown) => {
      run(async () => {
        const request = incomingMessageToRequest(opts.req, opts.res, {
          maxBodySize: opts.maxBodySize ?? null,
        });

        // Build tRPC dependencies
        const createContext: ResolveHTTPRequestOptionsContextFn<
          TRouter
        > = async (innerOpts) => {
          return await opts.createContext?.({
            ...opts,
            ...innerOpts,
          });
        };

        const response = await resolveResponse({
          ...opts,
          req: request,
          error: err ? getTRPCErrorFromUnknown(err) : null,
          createContext,
          onError(o) {
            opts?.onError?.({
              ...o,
              req: opts.req,
            });
          },
        });

        await writeResponse({
          request,
          response,
          rawResponse: opts.res,
        });
      }).catch(internal_exceptionHandler(opts));
    });
  });
}

import { initTRPC, TRPCError } from '@trpc/server';
import type { Context } from './context.js';
import * as auth from '../lib/auth.js';
import { logger } from '../lib/logger.js';

const t = initTRPC.context<Context>().create();

export const router = t.router;
export const publicProcedure = t.procedure;

// Authenticated procedure middleware
export const protectedProcedure = t.procedure.use(({ ctx, next }) => {
    if (!ctx.user) {
        throw new TRPCError({ code: 'UNAUTHORIZED', message: 'Authentication required' });
    }
    return next({ ctx: { ...ctx, user: ctx.user } });
});

// Admin-only procedure middleware
export const adminProcedure = protectedProcedure.use(({ ctx, next }) => {
    if (!auth.isAdminToken(ctx.user)) {
        throw new TRPCError({ code: 'FORBIDDEN', message: 'Admin access required' });
    }
    return next({ ctx });
});

// Teacher/Admin procedure middleware
export const teacherProcedure = protectedProcedure.use(({ ctx, next }) => {
    const roles = ctx.user.roles.map(r => r.role);
    if (!roles.includes('admin') && !roles.includes('teacher')) {
        throw new TRPCError({ code: 'FORBIDDEN', message: 'Teacher access required' });
    }
    return next({ ctx });
});
// Shared secret procedure (for machines)
export const sharedSecretProcedure = t.procedure.use(({ ctx, next }) => {
    const secret = process.env.SHARED_SECRET;
    if (secret !== undefined && secret !== '') {
        const authHeader = ctx.req.headers.authorization;
        if (authHeader !== `Bearer ${secret}`) {
            logger.warn('Failed shared secret authentication attempt', {
                path: ctx.req.path,
                ip: ctx.req.ip
            });
            throw new TRPCError({ code: 'UNAUTHORIZED', message: 'Invalid or missing shared secret' });
        }
    }
    return next({ ctx });
});

import { z } from 'zod';
import { router, publicProcedure, protectedProcedure } from '../trpc.js';
import { TRPCError } from '@trpc/server';
import {
    LoginDTOSchema,
    CreateUserDTOSchema,
} from '../../types/index.js';
import { AuthService } from '../../services/index.js';

export const authRouter = router({
    /**
     * Register a new user.
     * Public endpoint.
     */
    register: publicProcedure
        .input(CreateUserDTOSchema)
        .mutation(async ({ input }) => {
            const result = await AuthService.register(input);
            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }
            return result.data;
        }),

    /**
     * Log in user and return JWT tokens.
     * Public endpoint.
     */
    login: publicProcedure
        .input(LoginDTOSchema)
        .mutation(async ({ input }) => {
            const result = await AuthService.login(input.email, input.password);
            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }
            return result.data;
        }),

    /**
     * Refresh access token using refresh token.
     */
    refresh: publicProcedure
        .input(z.object({ refreshToken: z.string() }))
        .mutation(async ({ input }) => {
            const result = await AuthService.refresh(input.refreshToken);
            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }
            return result.data;
        }),

    /**
     * Logout user.
     */
    logout: protectedProcedure
        .input(z.object({ refreshToken: z.string().optional() }))
        .mutation(async ({ input, ctx }) => {
            const accessToken = ctx.req.headers.authorization?.slice(7);
            const result = await AuthService.logout(accessToken, input.refreshToken);
            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }
            return result.data;
        }),

    /**
     * Get current user profile.
     */
    me: protectedProcedure.query(async ({ ctx }) => {
        const result = await AuthService.getProfile(ctx.user.sub);
        if (!result.ok) {
            throw new TRPCError({ code: result.error.code, message: result.error.message });
        }
        return result.data;
    }),
});

import { z } from 'zod';
import { router, adminProcedure } from '../trpc.js';
import {
    UserRoleSchema,
    CreateUserDTOSchema,
} from '../../types/index.js';
import { TRPCError } from '@trpc/server';
import { UserService } from '../../services/index.js';
import * as roleStorage from '../../lib/role-storage.js';

export const usersRouter = router({
    list: adminProcedure.query(async () => {
        return await UserService.listUsers();
    }),

    get: adminProcedure
        .input(z.object({ id: z.string() }))
        .query(async ({ input }) => {
            const result = await UserService.getUser(input.id);
            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }
            return result.data;
        }),

    create: adminProcedure
        .input(CreateUserDTOSchema.extend({
            role: UserRoleSchema.optional(),
            groupIds: z.array(z.string()).optional(),
        }))
        .mutation(async ({ input }) => {
            // First check email
            const check = await UserService.getUserByEmail(input.email);
            if (check) throw new TRPCError({ code: 'CONFLICT', message: 'Email exists' });

            const result = await UserService.register(input);
            if (!result.ok) throw new TRPCError({ code: result.error.code, message: result.error.message });

            const user = result.data.user;
            if (input.role) {
                await UserService.assignRole(user.id, input.role, input.groupIds ?? []);
            }

            const final = await UserService.getUser(user.id);
            if (!final.ok) throw new TRPCError({ code: final.error.code, message: final.error.message });
            return final.data;
        }),

    update: adminProcedure
        .input(z.object({
            id: z.string(),
            name: z.string().optional(),
            email: z.string().email().optional(),
            active: z.boolean().optional(),
            password: z.string().min(8).optional(),
        }))
        .mutation(async ({ input }) => {
            const { id, ...updates } = input;
            const result = await UserService.updateUser(id, updates);
            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }

            const final = await UserService.getUser(id);
            if (!final.ok) throw new TRPCError({ code: final.error.code, message: final.error.message });
            return final.data;
        }),

    delete: adminProcedure
        .input(z.object({ id: z.string() }))
        .mutation(async ({ input, ctx }) => {
            if (ctx.user.sub === input.id) {
                throw new TRPCError({ code: 'BAD_REQUEST', message: 'Cannot delete yourself' });
            }
            const result = await UserService.deleteUser(input.id);
            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }
            return result.data;
        }),

    // Role management
    assignRole: adminProcedure
        .input(z.object({
            userId: z.string(),
            role: UserRoleSchema,
            groupIds: z.array(z.string()).default([]),
        }))
        .mutation(async ({ input }) => {
            const result = await UserService.assignRole(input.userId, input.role, input.groupIds);
            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }
            return result.data;
        }),

    revokeRole: adminProcedure
        .input(z.object({ userId: z.string(), roleId: z.string() }))
        .mutation(async ({ input }) => {
            const result = await UserService.revokeRole(input.roleId);
            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }
            return result.data;
        }),

    listTeachers: adminProcedure.query(async () => await roleStorage.getAllTeachers()),
});

import { z } from 'zod';
import { router, publicProcedure, protectedProcedure, teacherProcedure, adminProcedure } from '../trpc.js';
import {
    RequestStatusSchema,
    CreateRequestDTOSchema,
    getErrorMessage,
} from '../../types/index.js';
import { TRPCError } from '@trpc/server';
import { CreateRequestData } from '../../types/storage.js';
import * as storage from '../../lib/storage.js';
import * as github from '../../lib/github.js';
import { stripUndefined } from '../../lib/utils.js';
import { RequestService } from '../../services/index.js';

export const requestsRouter = router({
    /**
     * Create a new domain access request.
     * Public endpoint, requires valid email.
     */
    create: publicProcedure
        .input(CreateRequestDTOSchema)
        .mutation(async ({ input }) => {
            const result = await RequestService.createRequest(stripUndefined({
                domain: input.domain.toLowerCase(),
                reason: input.reason ?? 'No reason provided',
                requesterEmail: input.requesterEmail,
                groupId: input.groupId,
                priority: input.priority,
            }) as CreateRequestData);

            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }
            return result.data;
        }),

    /**
     * Get request status by ID.
     * Public endpoint for polling status.
     */
    getStatus: publicProcedure
        .input(z.object({ id: z.string() }))
        .query(async ({ input }) => {
            const request = await storage.getRequestById(input.id);
            if (!request) throw new TRPCError({ code: 'NOT_FOUND', message: 'Request not found' });
            return { id: request.id, domain: request.domain, status: request.status };
        }),

    /**
     * List all requests.
     * Protected endpoint.
     */
    list: protectedProcedure
        .input(z.object({ status: RequestStatusSchema.optional() }))
        .query(async ({ input, ctx }) => {
            return await RequestService.listRequests(input.status ?? null, ctx.user);
        }),

    /**
     * Get full request details by ID.
     * Protected endpoint. Enforces group access control.
     */
    get: protectedProcedure
        .input(z.object({ id: z.string() }))
        .query(async ({ input, ctx }) => {
            const result = await RequestService.getRequest(input.id, ctx.user);
            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }
            return result.data;
        }),

    /**
     * Approve a request.
     * Teacher/Admin endpoint.
     */
    approve: teacherProcedure
        .input(z.object({ id: z.string(), groupId: z.string().optional() }))
        .mutation(async ({ input, ctx }) => {
            const result = await RequestService.approveRequest(input.id, input.groupId, ctx.user);
            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }
            return result.data;
        }),

    // Teacher+: Reject
    reject: teacherProcedure
        .input(z.object({ id: z.string(), reason: z.string().optional() }))
        .mutation(async ({ input, ctx }) => {
            const result = await RequestService.rejectRequest(input.id, input.reason, ctx.user);
            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }
            return result.data;
        }),

    // Admin: Delete
    delete: adminProcedure
        .input(z.object({ id: z.string() }))
        .mutation(async ({ input }) => {
            const result = await RequestService.deleteRequest(input.id);
            if (!result.ok) {
                throw new TRPCError({ code: result.error.code, message: result.error.message });
            }
            return result.data;
        }),

    // Protected: List groups
    listGroups: protectedProcedure.query(async ({ ctx }) => {
        const allGroups = await github.listWhitelistFiles();
        const userGroups = RequestService.getApprovalGroupsForUser(ctx.user);
        if (userGroups === 'all') return allGroups;
        return allGroups.filter(g => userGroups.includes(g.name));
    }),

    // Admin: List blocked domains
    listBlocked: adminProcedure.query(async () => {
        try {
            const file = await github.getFileContent('blocked-subdomains.txt');
            const lines = file.content.split('\n');
            return lines.map(l => l.trim()).filter(l => l !== '' && !l.startsWith('#'));
        } catch (error) {
            const message = getErrorMessage(error);
            if (!message.includes('Not Found')) {
                throw new TRPCError({ code: 'INTERNAL_SERVER_ERROR', message });
            }
            return [];
        }
    }),

    // Protected: Check domain
    check: protectedProcedure
        .input(z.object({ domain: z.string() }))
        .mutation(async ({ input }) => {
            return await github.isDomainBlocked(input.domain);
        }),
});

