    machines: MachineInfo[];
    machineCount: number;
}

export interface UpdateClassroomData {
    name?: string;
    displayName?: string;
    defaultGroupId?: string;
    activeGroupId?: string;
}

// Use standard tRPC error codes for easy mapping
export type ClassroomServiceError =
    | { code: 'BAD_REQUEST'; message: string }
    | { code: 'NOT_FOUND'; message: string }
    | { code: 'CONFLICT'; message: string }
    | { code: 'INTERNAL_SERVER_ERROR'; message: string };

export type ClassroomResult<T> =
    | { ok: true; data: T }
    | { ok: false; error: ClassroomServiceError };

// =============================================================================
// Service Implementation
// =============================================================================

/**
 * List all classrooms with their machine counts and current state
 */
export async function listClassrooms(): Promise<ClassroomWithMachines[]> {
    const classrooms = await classroomStorage.getAllClassrooms();
    return Promise.all(classrooms.map(async (c) => {
        const rawMachines = await classroomStorage.getMachinesByClassroom(c.id);
        const machines: MachineInfo[] = rawMachines.map(m => ({
            hostname: m.hostname,
            lastSeen: m.lastSeen?.toISOString() ?? null,
            status: 'unknown' as const
        }));

        // Use schedule service for current group
        const currentSchedule = await scheduleStorage.getCurrentSchedule(c.id);
        const currentGroupId = c.activeGroupId ?? currentSchedule?.groupId ?? c.defaultGroupId;

        return {
            id: c.id,
            name: c.name,
            displayName: c.displayName,
            defaultGroupId: c.defaultGroupId,
            activeGroupId: c.activeGroupId,
            createdAt: c.createdAt.toISOString(),
            updatedAt: c.updatedAt.toISOString(),
            currentGroupId,
            machines,
            machineCount: machines.length,
        };
    }));
}

/**
 * Get a specific classroom with its machines and current state
 */
export async function getClassroom(id: string): Promise<ClassroomResult<ClassroomWithMachines>> {
    const classroom = await classroomStorage.getClassroomById(id);
    if (!classroom) return { ok: false, error: { code: 'NOT_FOUND', message: 'Classroom not found' } };

    const rawMachines = await classroomStorage.getMachinesByClassroom(id);
    const machines: MachineInfo[] = rawMachines.map(m => ({
        hostname: m.hostname,
        lastSeen: m.lastSeen?.toISOString() ?? null,
        status: 'unknown' as const
    }));

    const currentSchedule = await scheduleStorage.getCurrentSchedule(id);
    const currentGroupId = classroom.activeGroupId ?? currentSchedule?.groupId ?? classroom.defaultGroupId;

    return {
        ok: true,
        data: {
            id: classroom.id,
            name: classroom.name,
            displayName: classroom.displayName,
            defaultGroupId: classroom.defaultGroupId,
            activeGroupId: classroom.activeGroupId,
            createdAt: (classroom.createdAt ?? new Date()).toISOString(),
            updatedAt: (classroom.updatedAt ?? new Date()).toISOString(),
            currentGroupId,
            machines,
            machineCount: machines.length,
        }
    };
}

/**
 * Register a machine to a classroom
 */
export async function registerMachine(
    input: RegisterMachineInput
): Promise<ClassroomResult<MachineRegistrationResult>> {
    // Validate hostname
    if (!input.hostname || input.hostname.trim() === '') {
        return {
            ok: false,
            error: { code: 'BAD_REQUEST', message: 'Hostname required' }
        };
    }

    // Resolve classroom ID
    let classroomId = input.classroomId;

    if (!classroomId && input.classroomName) {
        const classroom = await classroomStorage.getClassroomByName(input.classroomName);
        if (classroom) {
            classroomId = classroom.id;
        }
    }

    if (!classroomId) {
        return {
            ok: false,
            error: { code: 'NOT_FOUND', message: 'Valid classroom_id or classroom_name is required' }
        };
    }

    // Register the machine
    const machine = await classroomStorage.registerMachine({
        hostname: input.hostname,
        classroomId,
        ...(input.version ? { version: input.version } : {}),
    });

    // Get classroom name
    const classroom = await classroomStorage.getClassroomById(classroomId);

    // Type the result properly
    const result: MachineRegistrationResult = {
        hostname: machine.hostname,
        classroomId: machine.classroomId ?? classroomId,
        classroomName: classroom?.name ?? '',
        lastSeen: machine.lastSeen?.toISOString() ?? new Date().toISOString(),
        ...(machine.version !== null && { version: machine.version })
    };

    return {
        ok: true,
        data: result
    };
}

/**
 * Get the whitelist URL for a machine
 */
export async function getWhitelistUrl(
    hostname: string
): Promise<ClassroomResult<WhitelistUrlResult>> {
    // Validate hostname
    if (!hostname || hostname.trim() === '') {
        return {
            ok: false,
            error: { code: 'BAD_REQUEST', message: 'Hostname required' }
        };
    }

    // Update last seen timestamp
    await classroomStorage.updateMachineLastSeen(hostname);

    const machine = await classroomStorage.getMachineOnlyByHostname(hostname);
    if (!machine?.classroomId) {
        return {
            ok: false,
            error: { code: 'NOT_FOUND', message: 'Machine not found or not assigned to a classroom' }
        };
    }

    const classroom = await classroomStorage.getClassroomById(machine.classroomId);
    if (!classroom) {
        return {
            ok: false,
            error: { code: 'NOT_FOUND', message: 'Classroom not found' }
        };
    }

    let groupId = classroom.activeGroupId;
    let source: 'manual' | 'schedule' | 'default' = 'manual';

    if (groupId === null) {
        // Try to get from schedule
        const currentSchedule = await scheduleStorage.getCurrentSchedule(classroom.id);
        if (currentSchedule) {
            groupId = currentSchedule.groupId;
            source = 'schedule';
        }
    }

    if (groupId === null) {
        groupId = classroom.defaultGroupId;
        source = 'default';
    }

    if (groupId === null) {
        return {
            ok: false,
            error: { code: 'BAD_REQUEST', message: 'No whitelist group configured for this classroom' }
        };
    }

    const owner = process.env.GITHUB_OWNER ?? 'LasEncinasIT';
    const repo = process.env.GITHUB_REPO ?? 'Whitelist-por-aula';
    const branch = process.env.GITHUB_BRANCH ?? 'main';
    const url = `https://raw.githubusercontent.com/${owner}/${repo}/refs/heads/${branch}/${encodeURIComponent(groupId)}.txt`;

    return {
        ok: true,
        data: {
            url,
            groupId,
            classroomId: classroom.id,
            classroomName: classroom.name,
            source
        }
    };
}

// =============================================================================
// Default Export
// =============================================================================

export default {
    registerMachine,
    getWhitelistUrl,
    listClassrooms,
    getClassroom
};

/**
 * RequestService - Business logic for domain request handling
 */

import * as storage from '../lib/storage.js';
import * as github from '../lib/github.js';
import * as push from '../lib/push.js';
import * as auth from '../lib/auth.js';
import { logger } from '../lib/logger.js';
import type { JWTPayload } from '../lib/auth.js';
import type { CreateRequestData } from '../types/storage.js';
import type { DomainRequest, RequestStatus } from '../types/index.js';
import { getErrorMessage } from '@openpath/shared';

// =============================================================================
// Types
// =============================================================================

export type RequestServiceError =
    | { code: 'CONFLICT'; message: string }
    | { code: 'NOT_FOUND'; message: string }
    | { code: 'FORBIDDEN'; message: string }
    | { code: 'BAD_REQUEST'; message: string };

export type RequestResult<T> =
    | { ok: true; data: T }
    | { ok: false; error: RequestServiceError };

// =============================================================================
// Service Implementation
// =============================================================================

/**
 * Create a new domain access request
 */
export async function createRequest(
    input: CreateRequestData
): Promise<RequestResult<DomainRequest>> {
    if (await storage.hasPendingRequest(input.domain)) {
        return {
            ok: false,
            error: { code: 'CONFLICT', message: 'Pending request exists for this domain' }
        };
    }

    try {
        const request = await storage.createRequest(input);

        // Notify teachers asynchronously (non-blocking)
        push.notifyTeachersOfNewRequest(request).catch((error: unknown) => {
            logger.error('Failed to notify teachers of new request', {
                requestId: request.id,
                domain: request.domain,
                error: getErrorMessage(error)
            });
        });

        return { ok: true, data: request };
    } catch (error) {
        return {
            ok: false,
            error: { code: 'BAD_REQUEST', message: getErrorMessage(error) }
        };
    }
}

/**
 * Approve a request
 */
export async function approveRequest(
    id: string,
    groupId: string | undefined,
    user: JWTPayload
): Promise<RequestResult<DomainRequest>> {
    const request = await storage.getRequestById(id);
    if (!request) {
        return { ok: false, error: { code: 'NOT_FOUND', message: 'Request not found' } };
    }

    if (request.status !== 'pending') {
        return {
            ok: false,
            error: { code: 'BAD_REQUEST', message: `Request is already ${request.status}` }
        };
    }

    const targetGroup = groupId ?? request.groupId;
    if (!auth.canApproveGroup(user, targetGroup)) {
        return {
            ok: false,
            error: { code: 'FORBIDDEN', message: 'You do not have permission to approve for this group' }
        };
    }

    // Check blocked domains for non-admins
    if (!auth.isAdminToken(user)) {
        const blocked = await github.isDomainBlocked(request.domain);
        if (blocked.blocked) {
            return {
                ok: false,
                error: { code: 'FORBIDDEN', message: 'This domain is explicitly blocked' }
            };
        }
    }

    try {
        await github.addDomainToWhitelist(request.domain, targetGroup);
        const updated = await storage.updateRequestStatus(
            request.id,
            'approved',
            user.name,
            `Added to ${targetGroup}`
        );

        if (!updated) {
            return { ok: false, error: { code: 'NOT_FOUND', message: 'Failed to update request status' } };
        }

        return { ok: true, data: updated };
    } catch (error) {
        return {
            ok: false,
            error: { code: 'BAD_REQUEST', message: getErrorMessage(error) }
        };
    }
}

/**
 * Reject a request
 */
export async function rejectRequest(
    id: string,
    reason: string | undefined,
    user: JWTPayload
): Promise<RequestResult<DomainRequest>> {
    const request = await storage.getRequestById(id);
    if (!request) {
        return { ok: false, error: { code: 'NOT_FOUND', message: 'Request not found' } };
    }

    if (request.status !== 'pending') {
        return {
            ok: false,
            error: { code: 'BAD_REQUEST', message: `Request is already ${request.status}` }
        };
    }

    // Security check: teacher must have access to the group
    if (!auth.canApproveGroup(user, request.groupId)) {
        return {
            ok: false,
            error: { code: 'FORBIDDEN', message: 'You do not have permission to manage this request' }
        };
    }

    const updated = await storage.updateRequestStatus(
        request.id,
        'rejected',
        user.name,
        reason
    );

    if (!updated) {
        return { ok: false, error: { code: 'NOT_FOUND', message: 'Failed to update request status' } };
    }

    return { ok: true, data: updated };
}

/**
 * List requests with role-based filtering
 */
export async function listRequests(
    status: RequestStatus | null,
    user: JWTPayload
): Promise<DomainRequest[]> {
    let requests = await storage.getAllRequests(status);

    const groups = auth.getApprovalGroups(user);
    if (groups !== 'all') {
        requests = requests.filter(r => groups.includes(r.groupId));
    }

    return requests;
}

/**
 * Get a specific request with access control
 */
export async function getRequest(
    id: string,
    user: JWTPayload
): Promise<RequestResult<DomainRequest>> {
    const request = await storage.getRequestById(id);
    if (!request) {
        return { ok: false, error: { code: 'NOT_FOUND', message: 'Request not found' } };
    }

    const groups = auth.getApprovalGroups(user);
    if (groups !== 'all' && !groups.includes(request.groupId)) {
        return {
            ok: false,
            error: { code: 'FORBIDDEN', message: 'You do not have access to this request' }
        };
    }

    return { ok: true, data: request };
}

/**
 * Delete a request
 */
export async function deleteRequest(id: string): Promise<RequestResult<{ success: boolean }>> {
    const deleted = await storage.deleteRequest(id);
    if (!deleted) {
        return { ok: false, error: { code: 'NOT_FOUND', message: 'Request not found' } };
    }
    return { ok: true, data: { success: true } };
}

/**
 * Get approval groups for user
 */
export function getApprovalGroupsForUser(user: JWTPayload): string[] | 'all' {
    return auth.getApprovalGroups(user);
}

// =============================================================================
// Default Export
// =============================================================================

export default {
    createRequest,
    approveRequest,
    rejectRequest,
    listRequests,
    getRequest,
    deleteRequest,
    getApprovalGroupsForUser
};

/**
 * AuthService - Business logic for authentication
 */

import * as userStorage from '../lib/user-storage.js';
import * as roleStorage from '../lib/role-storage.js';
import * as auth from '../lib/auth.js';
import { logger } from '../lib/logger.js';
import type { 
    SafeUser, 
    LoginResponse,
    UserRole
} from '../types/index.js';
import type { CreateUserData } from '../types/storage.js';
import { getErrorMessage } from '@openpath/shared';

// =============================================================================
// Types
// =============================================================================

export type AuthServiceError =
    | { code: 'CONFLICT'; message: string }
    | { code: 'UNAUTHORIZED'; message: string }
    | { code: 'FORBIDDEN'; message: string }
    | { code: 'NOT_FOUND'; message: string };

export type AuthResult<T> =
    | { ok: true; data: T }
    | { ok: false; error: AuthServiceError };

export interface TokenPair {
    accessToken: string;
    refreshToken: string;
    expiresIn: string;
    tokenType: 'Bearer';
}

// =============================================================================
// Service Implementation
// =============================================================================

/**
 * Register a new user
 */
export async function register(
    input: CreateUserData
): Promise<AuthResult<{ user: SafeUser }>> {
    try {
        if (await userStorage.emailExists(input.email)) {
            return {
                ok: false,
                error: { code: 'CONFLICT', message: 'Email already registered' }
            };
        }
        const user = await userStorage.createUser(input);
        return { ok: true, data: { user: { id: user.id, email: user.email, name: user.name } as SafeUser } };
    } catch (error) {
        logger.error('auth.register error', { error: getErrorMessage(error) });
        return {
            ok: false,
            error: { code: 'UNAUTHORIZED', message: getErrorMessage(error) }
        };
    }
}

/**
 * Login user and return tokens
 */
export async function login(
    email: string,
    password: string
): Promise<AuthResult<LoginResponse>> {
    try {
        const user = await userStorage.verifyPasswordByEmail(email, password);
        if (!user) {
            return { ok: false, error: { code: 'UNAUTHORIZED', message: 'Invalid credentials' } };
        }
        if (!user.isActive) {
            return { ok: false, error: { code: 'FORBIDDEN', message: 'Account inactive' } };
        }

        const roles = await roleStorage.getUserRoles(user.id);
        const tokens = auth.generateTokens(user, roles.map(r => ({ 
            role: r.role as 'admin' | 'teacher' | 'student', 
            groupIds: r.groupIds ?? [] 
        })));

        return {
            ok: true,
            data: {
                ...tokens,
                expiresIn: parseInt(tokens.expiresIn) || 86400, // Standardize to number
                user: {
                    id: user.id,
                    email: user.email,
                    name: user.name,
                    roles: roles.map(r => ({
                        id: r.id,
                        userId: r.userId,
                        role: r.role as UserRole,
                        groupIds: r.groupIds ?? [],
                        createdAt: r.createdAt?.toISOString() ?? new Date().toISOString(),
                        updatedAt: r.updatedAt?.toISOString() ?? new Date().toISOString(),
                        createdBy: r.createdBy,
                        revokedAt: null
                    }))
                } as unknown as SafeUser
            }
        };
    } catch (error) {
        logger.error('auth.login error', { error: getErrorMessage(error) });
        return {
            ok: false,
            error: { code: 'UNAUTHORIZED', message: getErrorMessage(error) }
        };
    }
}

/**
 * Refresh access token
 */
export async function refresh(
    refreshToken: string
): Promise<AuthResult<TokenPair>> {
    const decoded = await auth.verifyRefreshToken(refreshToken);
    if (!decoded) {
        return { ok: false, error: { code: 'UNAUTHORIZED', message: 'Invalid refresh token' } };
    }

    const user = await userStorage.getUserById(decoded.sub);
    if (user?.isActive !== true) {
        return { ok: false, error: { code: 'UNAUTHORIZED', message: 'User not found or inactive' } };
    }

    await auth.blacklistToken(refreshToken);
    const roles = await roleStorage.getUserRoles(user.id);
    const tokens = auth.generateTokens(user, roles.map(r => ({ 
        role: r.role as 'admin' | 'teacher' | 'student', 
        groupIds: r.groupIds ?? [] 
    })));

    return { ok: true, data: tokens as TokenPair };
}

/**
 * Logout user
 */
export async function logout(
    accessToken?: string,
    refreshToken?: string
): Promise<AuthResult<{ success: boolean }>> {
    if (accessToken) await auth.blacklistToken(accessToken);
    if (refreshToken) await auth.blacklistToken(refreshToken);
    return { ok: true, data: { success: true } };
}

/**
 * Get user profile
 */
export async function getProfile(
    userId: string
): Promise<AuthResult<{ user: SafeUser }>> {
    const user = await userStorage.getUserById(userId);
    if (!user) {
        return { ok: false, error: { code: 'NOT_FOUND', message: 'User not found' } };
    }

    const roles = await roleStorage.getUserRoles(user.id);
    return {
        ok: true,
        data: {
            user: {
                id: user.id,
                email: user.email,
                name: user.name,
                roles: roles.map(r => ({
                    id: r.id,
                    userId: r.userId,
                    role: r.role as UserRole,
                    groupIds: r.groupIds ?? [],
                    createdAt: r.createdAt?.toISOString() ?? new Date().toISOString(),
                    updatedAt: r.updatedAt?.toISOString() ?? new Date().toISOString(),
                    createdBy: r.createdBy,
                    revokedAt: null
                }))
            } as unknown as SafeUser
        }
    };
}

// =============================================================================
// Default Export
// =============================================================================

export default {
    register,
    login,
    refresh,
    logout,
    getProfile
};

/**
 * ScheduleService - Business logic for schedule management
 */

import * as scheduleStorage from '../lib/schedule-storage.js';
import * as classroomStorage from '../lib/classroom-storage.js';
import * as auth from '../lib/auth.js';
import type { 
    Schedule, 
    JWTPayload 
} from '../types/index.js';
import { getErrorMessage } from '@openpath/shared';

// =============================================================================
// Types
// =============================================================================

export type ScheduleServiceError =
    | { code: 'NOT_FOUND'; message: string }
    | { code: 'FORBIDDEN'; message: string }
    | { code: 'CONFLICT'; message: string }
    | { code: 'BAD_REQUEST'; message: string };

export type ScheduleResult<T> =
    | { ok: true; data: T }
    | { ok: false; error: ScheduleServiceError };

export interface ScheduleWithPermissions extends Schedule {
    isMine: boolean;
    canEdit: boolean;
}

export interface ClassroomScheduleResult {
    classroom: {
        id: string;
        name: string;
        displayName: string;
    };
    schedules: ScheduleWithPermissions[];
}

// =============================================================================
// Helper Functions
// =============================================================================

interface StorageSchedule {
    id: string;
    classroomId: string;
    dayOfWeek: number;
    startTime: string;
    endTime: string;
    groupId: string;
    teacherId: string;
    recurrence: string | null;
    createdAt: Date | null;
    updatedAt: Date | null;
}

function mapToSchedule(s: StorageSchedule): Schedule {
    return {
        id: s.id,
        classroomId: s.classroomId,
        dayOfWeek: s.dayOfWeek,
        startTime: s.startTime,
        endTime: s.endTime,
        groupId: s.groupId,
        teacherId: s.teacherId,
        recurrence: s.recurrence ?? 'weekly',
        createdAt: s.createdAt?.toISOString() ?? new Date().toISOString(),
        updatedAt: s.updatedAt?.toISOString() ?? undefined,
    };
}

// =============================================================================
// Service Implementation
// =============================================================================

/**
 * Get schedules for a classroom with user permissions
 */
export async function getSchedulesByClassroom(
    classroomId: string,
    user: JWTPayload
): Promise<ScheduleResult<ClassroomScheduleResult>> {
    const classroom = await classroomStorage.getClassroomById(classroomId);
    if (!classroom) {
        return { ok: false, error: { code: 'NOT_FOUND', message: 'Classroom not found' } };
    }

    const schedules = await scheduleStorage.getSchedulesByClassroom(classroomId);
    const userId = user.sub;
    const isAdmin = auth.isAdminToken(user);

    return {
        ok: true,
        data: {
            classroom: {
                id: classroom.id,
                name: classroom.name,
                displayName: classroom.displayName
            },
            schedules: schedules.map(s => ({
                ...mapToSchedule(s),
                isMine: s.teacherId === userId,
                canEdit: s.teacherId === userId || isAdmin,
            }))
        }
    };
}

/**
 * Create a new schedule reservation
 */
export async function createSchedule(
    input: {
        classroomId: string;
        groupId: string;
        dayOfWeek: number;
        startTime: string;
        endTime: string;
    },
    user: JWTPayload
): Promise<ScheduleResult<Schedule>> {
    const classroom = await classroomStorage.getClassroomById(input.classroomId);
    if (!classroom) {
        return { ok: false, error: { code: 'NOT_FOUND', message: 'Classroom not found' } };
    }

    const isAdmin = auth.isAdminToken(user);
    if (!isAdmin && !auth.canApproveGroup(user, input.groupId)) {
        return {
            ok: false,
            error: { code: 'FORBIDDEN', message: 'You can only create schedules for your assigned groups' }
        };
    }

    try {
        const schedule = await scheduleStorage.createSchedule({
            classroomId: input.classroomId,
            teacherId: user.sub,
            groupId: input.groupId,
            dayOfWeek: input.dayOfWeek,
            startTime: input.startTime,
            endTime: input.endTime,
        });
        return { ok: true, data: mapToSchedule(schedule) };
    } catch (error: unknown) {
        const message = getErrorMessage(error);
        if (message === 'Schedule conflict') {
            return {
                ok: false,
                error: { code: 'CONFLICT', message: 'This time slot is already reserved' }
            };
        }
        return { ok: false, error: { code: 'BAD_REQUEST', message } };
    }
}

/**
 * Update an existing schedule
 */
export async function updateSchedule(
    id: string,
    input: {
        dayOfWeek?: number | undefined;
        startTime?: string | undefined;
        endTime?: string | undefined;
        groupId?: string | undefined;
    },
    user: JWTPayload
): Promise<ScheduleResult<Schedule>> {
    const schedule = await scheduleStorage.getScheduleById(id);
    if (!schedule) {
        return { ok: false, error: { code: 'NOT_FOUND', message: 'Schedule not found' } };
    }

    const isAdmin = auth.isAdminToken(user);
    const isOwner = schedule.teacherId === user.sub;

    if (!isOwner && !isAdmin) {
        return {
            ok: false,
            error: { code: 'FORBIDDEN', message: 'You can only manage your own schedules' }
        };
    }

    if (input.groupId !== undefined && input.groupId !== '' && input.groupId !== schedule.groupId) {
        if (!isAdmin && !auth.canApproveGroup(user, input.groupId)) {
            return {
                ok: false,
                error: { code: 'FORBIDDEN', message: 'You can only use your assigned groups' }
            };
        }
    }

    try {
        const updated = await scheduleStorage.updateSchedule(id, input);
        if (!updated) {
            return { ok: false, error: { code: 'NOT_FOUND', message: 'Schedule not found after update' } };
        }
        return { ok: true, data: mapToSchedule(updated) };
    } catch (error: unknown) {
        const message = getErrorMessage(error);
        if (message === 'Schedule conflict') {
            return {
                ok: false,
                error: { code: 'CONFLICT', message: 'This time slot is already reserved' }
            };
        }
        return { ok: false, error: { code: 'BAD_REQUEST', message } };
    }
}

/**
 * Delete a schedule reservation
 */
export async function deleteSchedule(
    id: string,
    user: JWTPayload
): Promise<ScheduleResult<{ success: boolean }>> {
    const schedule = await scheduleStorage.getScheduleById(id);
    if (!schedule) {
        return { ok: false, error: { code: 'NOT_FOUND', message: 'Schedule not found' } };
    }

    const isAdmin = auth.isAdminToken(user);
    const isOwner = schedule.teacherId === user.sub;

    if (!isOwner && !isAdmin) {
        return {
            ok: false,
            error: { code: 'FORBIDDEN', message: 'You can only manage your own schedules' }
        };
    }

    await scheduleStorage.deleteSchedule(id);
    return { ok: true, data: { success: true } };
}

/**
 * Get current active schedule for a classroom
 */
export async function getCurrentSchedule(classroomId: string): Promise<Schedule | null> {
    const s = await scheduleStorage.getCurrentSchedule(classroomId);
    return s ? mapToSchedule(s) : null;
}

/**
 * Get schedules for a teacher
 */
export async function getSchedulesByTeacher(
    teacherId: string
): Promise<Schedule[]> {
    const s = await scheduleStorage.getSchedulesByTeacher(teacherId);
    return s.map(mapToSchedule);
}

